export enum MessagesErreurEnum {
  CONNEXION_ESTIME_IMPOSSIBLE = "La connexion au service a échoué. Merci d'essayer de nouveau et de contacter le support Estime si le problème persiste.",
  SIMULATION_IMPOSSIBLE = "Impossibe d'obtenir votre simulation. Merci d'essayer de nouveau et de contacter le support Estime si le problème persiste.",
  ERREUR_SERVICE = "Erreur du service, merci d'essayer de nouveau et de contacter le support Estime si le problème persiste."

