import { Injectable } from '@angular/core';
import { DateDecomposee } from "@models/date-decomposee";

@Injectable({providedIn: 'root'})
export class DateUtileService {

  mois = [
    { label: "Janvier", value: 1 },
    { label: "Février", value: 2 },
    { label: "Mars", value: 3 },
    { label: "Avril", value: 4 },
    { label: "Mai", value: 5 },
    { label: "Juin", value: 6 },
    { label: "Juillet", value: 7 },
    { label: "Août", value: 8 },
    { label: "Septembre", value: 9 },
    { label: "Octobre", value: 10 },
    { label: "Novembre", value: 11 },
    { label: "Décembre", value: 12 },
  ];

  isBissextile(annee: number): boolean {
    return (annee % 100 === 0) ? (annee % 400 === 0) : (annee % 4 === 0);
  }

  getNombreJoursMois(mois:number, annee:number): number {
    return new Date(annee, mois, 0).getDate();
  }

  getNombreJoursMoisPrecedent(): number {
    const dateJour = new Date();
    const month = dateJour.getMonth();
    const year =  dateJour.getFullYear();
    return this.getNombreJoursMois(month, year);
  }

  isFormatDateValide(dateDecomposee: DateDecomposee): boolean {
    return this.checkFormat(dateDecomposee) === undefined;
  }

  /**
   * Retourne un string au format "mois en lettre + année (ex : janvier 2020)"
   * @param dateSimulation
   */
  getDateStringFormat(dateSimulation: string): string {
    const dateSimulationSplit = dateSimulation.split('-');
    const moisLabel = this.getLibelleMoisByMoisNumber(parseInt(dateSimulationSplit[1]));
    return `${moisLabel} ${dateSimulationSplit[0]}`;
  }

  /**
   * transforme YYYY-MM-DD en JJ/MM/YYYY
   * @param date
   */
  getDateStringFormat2(date: string): string {
    const dateSimulationSplit = date.split('-');
    return dateSimulationSplit[2] + '/' + dateSimulationSplit[1] + '/' + dateSimulationSplit[0];
  }

  checkFormat(dateDecomposee: DateDecomposee): string {
    let errorFormatMessage = undefined;
    const nbJourMois = this.getNombreJoursMois(parseInt(dateDecomposee.mois), parseInt(dateDecomposee.annee));
    if(dateDecomposee.jour) {
      if(parseInt(dateDecomposee.jour) > nbJourMois) {
        errorFormatMessage = "Le jour doit être inférieur ou égal à " + nbJourMois;
      }
      if(dateDecomposee.jour.length != 2) {
        errorFormatMessage = "Le jour doit être au format JJ";
      }
      if(dateDecomposee.jour === "00") {
        errorFormatMessage = "Le jour est incorrect";
      }
    }
    if(dateDecomposee.mois) {
      if(dateDecomposee.mois.length != 2) {
        errorFormatMessage = "Le mois doit être au format MM";
      }
      if(parseInt(dateDecomposee.mois) > 12 || dateDecomposee.mois === "00") {
        errorFormatMessage = "Le mois est incorrect";
      }
    }
    if(dateDecomposee.annee && dateDecomposee.annee.length != 4) {
      errorFormatMessage = "L'année doit être au format AAAA";
    }
    const annee = new Date().getFullYear();
    if(parseInt(dateDecomposee.annee) > annee) {
      errorFormatMessage = "L'année ne peut pas être supérieure à l'année en cours";
    }
    return errorFormatMessage;
  }

  isDateDecomposeeSaisieValide(dateDecomposee: DateDecomposee): boolean {
    let isDateDecomposeeSaisieValide = false;
    if(!dateDecomposee.messageErreurFormat
      && dateDecomposee.jour
      && dateDecomposee.mois
      && dateDecomposee.annee) {
        isDateDecomposeeSaisieValide = true;
    }
    return isDateDecomposeeSaisieValide;
  }

  getDateDecomposeeFromDate(dateADecompose: Date): DateDecomposee {
    const dateDecomposee = new DateDecomposee();
    if(dateADecompose) {
      let dateADecomposeDate = new Date(dateADecompose);
      const jour = dateADecomposeDate.getDate();
      const mois = dateADecomposeDate.getMonth() + 1;
      dateDecomposee.jour = this.addZeroToNumber(jour);
      dateDecomposee.mois = this.addZeroToNumber(mois);
      dateDecomposee.annee = dateADecomposeDate.getFullYear().toString();
    } else {
      dateDecomposee.mois = null;
    }
    return dateDecomposee;
  }

  getDateDecomposeeFromStringDate(dateADecompose: string) {
    const dateDecomposee = new DateDecomposee();
    if(dateADecompose) {
      const dateADecomposeTab = dateADecompose.split("-");
      dateDecomposee.jour = dateADecomposeTab[2];
      dateDecomposee.mois = dateADecomposeTab[1];
      dateDecomposee.annee = dateADecomposeTab[0];
    } else {
      dateDecomposee.mois = null;
    }
    return dateDecomposee;
  }

  getStringDateFromDateDecomposee(dateADecompose: DateDecomposee): string {
    return `${dateADecompose.annee}-${dateADecompose.mois}-${dateADecompose.jour}`;
  }

  getDateFromDateDecomposee(dateADecompose: DateDecomposee): Date {
    const dateFormat = new Date(
      parseInt(dateADecompose.annee),
      parseInt(dateADecompose.mois) - 1,
      parseInt(dateADecompose.jour));
    return dateFormat;
  }

  private addZeroToNumber(numberToAddZero: number): string {
    if(numberToAddZero < 10) {
      return '0' + numberToAddZero.toString();
    }
    return numberToAddZero.toString();
  }

  private isJourOuMoisValide(valueJourOuMois: string): boolean {
    return valueJourOuMois.length === 2 && valueJourOuMois !== "00"
  }

  private getLibelleMoisByMoisNumber(moisNumber: number): string {
    let moisLabel = '';
    this.mois.forEach(mois => {
      if(moisNumber === mois.value) {
        moisLabel = mois.label;
      }
    });
    return moisLabel;
  }
}

import { Injectable } from '@angular/core';
import { BeneficiaireAidesSociales } from '@models/beneficiaire-aides-sociales';
import { DateDecomposee } from '@models/date-decomposee';
import { AllocationsCAF } from "@models/allocations-caf";
import { AllocationsPoleEmploi } from "@models/allocations-pole-emploi";
import { InformationsPersonnelles } from "@models/informations-personnelles";
import { Personne } from "@models/personne";
import { RessourcesFinancieres } from "@models/ressources-financieres";
import { DateUtileService } from './date-util.service';

@Injectable({ providedIn: 'root' })
export class PersonneUtileService {

  AGE_LEGAL_POUR_TRAVAILLE = 16;

  constructor(
    private dateUtileService: DateUtileService
  ) {

  }

  public creerPersonne(isAvecRessourcesFinancieres: boolean): Personne {
    const personne = new Personne();
    personne.beneficiaireAidesSociales = new BeneficiaireAidesSociales(false, false, false, false);
    personne.informationsPersonnelles = new InformationsPersonnelles();
    personne.informationsPersonnelles.salarie = false;
    personne.informationsPersonnelles.sansRessource = false;
    if(isAvecRessourcesFinancieres) {
      personne.ressourcesFinancieres = new RessourcesFinancieres();
      personne.ressourcesFinancieres.allocationsCAF = new AllocationsCAF();
      personne.ressourcesFinancieres.allocationsPoleEmploi = new AllocationsPoleEmploi();
    }
    return personne;
  }

  public hasRessourcesFinancieres(personne: Personne): boolean {
    let hasRessourcesFinancieres = false;
    if (personne.informationsPersonnelles) {
      if (!personne.informationsPersonnelles.sansRessource
        && (personne.informationsPersonnelles.salarie
          || this.hasRessourcesAidesSociales(personne))) {
        hasRessourcesFinancieres = true;
      }
    }
    return hasRessourcesFinancieres;
  }

  public isAgeLegalPourTravailler(dateNaissance: DateDecomposee): boolean {
    const dateNaissanceFormatDate = this.dateUtileService.getDateFromDateDecomposee(dateNaissance);
    const diffEnMilliseconds = Date.now() - dateNaissanceFormatDate.getTime();
    const dateAge = new Date(diffEnMilliseconds);
    const ageEnAnnee = Math.abs(dateAge.getUTCFullYear() - 1970);
    return ageEnAnnee >= this.AGE_LEGAL_POUR_TRAVAILLE ? true : false;
  }

  private hasRessourcesAidesSociales(personne: Personne): boolean {
    return personne.beneficiaireAidesSociales
      && (
        personne.beneficiaireAidesSociales.beneficiaireAAH
        || personne.beneficiaireAidesSociales.beneficiaireARE
        || personne.beneficiaireAidesSociales.beneficiaireASS
        || personne.beneficiaireAidesSociales.beneficiaireRSA
      );
  }
}

import { Injectable } from '@angular/core';
import { AllocationsCAF } from "@models/allocations-caf";
import { AllocationsPoleEmploi } from "@models/allocations-pole-emploi";
import { RessourcesFinancieres } from "@models/ressources-financieres";
import { NumberUtileService } from "@app/core/services/utile/number-util.service";

@Injectable({ providedIn: 'root' })
export class RessourcesFinancieresUtileService {

  constructor(
    private numberUtileService: NumberUtileService
  ) {

  }

  public creerRessourcesFinancieres(): RessourcesFinancieres {
    const ressourcesFinancieres = new RessourcesFinancieres();
    const allocationsPE = new AllocationsPoleEmploi();
    allocationsPE.nombreMoisCumulesAssEtSalaire = 0;
    ressourcesFinancieres.allocationsPoleEmploi = allocationsPE;
    const allocationsCAF = new AllocationsCAF();
    allocationsCAF.allocationsFamilialesMensuellesNetFoyer = 0;
    allocationsCAF.allocationsLogementMensuellesNetFoyer = 0;
    allocationsCAF.pensionsAlimentairesFoyer = 0;
    ressourcesFinancieres.allocationsCAF = allocationsCAF;
    return ressourcesFinancieres;
  }

  /**
   * Méthode permettant de remplacer les virgules présentes dans les montants
   * pour lesquels on autorise l'utilisateur à saisir un montant avec une virgule ou un point.
   *
   * Transformation nécessaire car seul le point est autoriser côté serveur.
   *
   * TODO JLA : à voir si on ne peut pas faire mieux avec un pipe.
   * Peut-être pas possible car l'utilisation d'un pipe avec le two way data binding ne fonctionne pas.
   */
  public replaceCommaByDotMontantsRessourcesFinancieres(ressourcesFinancieres: RessourcesFinancieres) {
    if (ressourcesFinancieres.allocationsPoleEmploi) {
      ressourcesFinancieres.allocationsPoleEmploi.allocationJournaliereNetARE = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsPoleEmploi.allocationJournaliereNetARE);
      ressourcesFinancieres.allocationsPoleEmploi.allocationJournaliereNetASS = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsPoleEmploi.allocationJournaliereNetASS);
      ressourcesFinancieres.allocationsPoleEmploi.allocationMensuelleNetARE = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsPoleEmploi.allocationMensuelleNetARE);
      ressourcesFinancieres.allocationsPoleEmploi.allocationMensuelleNetASS = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsPoleEmploi.allocationMensuelleNetASS);
    }
    if (ressourcesFinancieres.allocationsCAF) {
      ressourcesFinancieres.allocationsCAF.allocationsFamilialesMensuellesNetFoyer = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsCAF.allocationsFamilialesMensuellesNetFoyer);
      ressourcesFinancieres.allocationsCAF.allocationsLogementMensuellesNetFoyer = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsCAF.allocationsLogementMensuellesNetFoyer);
      ressourcesFinancieres.allocationsCAF.allocationMensuelleNetAAH = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsCAF.allocationMensuelleNetAAH);
      ressourcesFinancieres.allocationsCAF.allocationMensuelleNetRSA = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsCAF.allocationMensuelleNetRSA);
      ressourcesFinancieres.allocationsCAF.pensionsAlimentairesFoyer = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.allocationsCAF.pensionsAlimentairesFoyer);
    }
    ressourcesFinancieres.salaireNet  = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.salaireNet);
    ressourcesFinancieres.revenusCreateurEntreprise3DerniersMois = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.revenusCreateurEntreprise3DerniersMois);
    ressourcesFinancieres.revenusImmobilier3DerniersMois = this.numberUtileService.replaceCommaByDot(ressourcesFinancieres.revenusImmobilier3DerniersMois);
    return ressourcesFinancieres;
  }

}

